import React from 'react';
import logo from './logo.svg';
import './App.css';
import Home from './pages/Home';
import Pages from './pages';
import { Route } from "react-router-dom";



function App() {
  return (  
  
    <div className="App">             
        <img src={logo} className="App-logo" alt="logo" />
      
            <Route path = "/welcome">
                <Welcome />
            </Route>
            <Route path = "/game">
                <Game />
            </Route>
            <Route path = "/leaderboard">
                <Leaderboard />
            </Route>
      
        
       
    </div>
   
  );
}

export default App;
